import React from 'react'

function Cards({results}) {
    console.log(results)
    let display;
    if(results)
    {
      display=results.map(x=>{
          let {id,name}=x;
          return <div className="col-4">{name}</div>
      });
    }
    else{
        display="No Characters Found :/"
    }
    return (
            <>{display}</>
    )
}

export default Cards;
